import os
import configparser


class Config:
    _instance = None
    _config = None

    def __init__(self):
        pass

    def __new__(cls, filename=None):
        if cls._instance is None:
            cls._instance = super(Config, cls).__new__(cls)
            cls._config = configparser.ConfigParser()
            if not filename:
                filename = os.path.join(os.path.dirname(os.path.dirname(__file__)), 'static', 'js', 'setting.ini')
            cls._config.read(filename, encoding="utf-8")

        return cls._instance

    def get(self, section, option, default=None):
        if not self._config.has_section(section):
            raise Exception(f'Section {section} not found in the config file')
        if not self._config.has_option(section, option):
            return default
        try:
            return eval(self._config.get(section, option))
        except:
            return self._config.get(section, option)


